// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract FuseToken1155 is ERC1155, Ownable {
    constructor() ERC1155("") {}

    function setURI(string memory newuri) public onlyOwner {
        _setURI(newuri);
    }

    function mint(
        address account,
        uint256 id,
        uint256 amount,
        bytes memory data
    ) public onlyOwner {
        _mint(account, id, amount, data);
    }

    function mintBatch(
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) public onlyOwner {
        _mintBatch(to, ids, amounts, data);
    }
}

contracts/FuseToken721.sol.content:
// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract FuseToken721 is ERC721, Ownable {
    using Counters for Counters.Counter;

    Counters.Counter private _tokenIdCounter;

    constructor() ERC721("FuseToken721", "FTC721") {}

    function safeMint(address to) public onlyOwner {
        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();
        _safeMint(to, tokenId);
    }
}

contracts/MerkleDistributor.sol.content:
// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.9;

import {IERC20, SafeERC20} from "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import {MerkleProof} from "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";

// import {IMerkleDistributor} from "./interfaces/IMerkleDistributor.sol";

contract MerkleDistributor {
    using SafeERC20 for IERC20;
    address public immutable tokenERC20;
    // address public immutable override token;
    bytes32 public immutable merkleRoot;
    uint256 public dropERC20;

    mapping(address => uint256) private claimedAddress;

    event ClaimedERC20(address indexed _from, uint256 _dropERC20);

    constructor(
        address token_,
        bytes32 merkleRoot_,
        uint256 dropERC20_
    ) {
        tokenERC20 = token_;
        merkleRoot = merkleRoot_;
        dropERC20 = dropERC20_;
    }

    function claim(bytes32[] calldata merkleProof) public virtual {
        require(claimedAddress[msg.sender] == 0, "Claimed ERC20");

        // Verify the merkle proof.
        bytes32 node = keccak256(abi.encodePacked(msg.sender));
        if (!MerkleProof.verify(merkleProof, merkleRoot, node))
            // Mark it claimed and send the token.
            claimedAddress[msg.sender] = 1;

        require(
            IERC20(tokenERC20).transfer(msg.sender, dropERC20),
            "Transfer failed"
        );

        emit ClaimedERC20(msg.sender, dropERC20);
    }
}

